function init(){
  if(location.hash.length > 1){ const conf = decodeConfig(location.hash.slice(1)); if(conf) Object.assign(state, conf); }
  el.titleInput.value = state.title || '';
  el.titleDisplay.textContent = state.title || 'æŠ½æŠ½æ¨‚';
  if(state.coverDataUrl){ el.coverImage.src = state.coverDataUrl; el.coverImage.style.display = 'block'; el.coverFallback.style.display = 'none'; }
  renderEditGrid(); el.allowRepeat.checked = !!state.allowRepeat; el.shuffleOnStart.checked = state.shuffleOnStart !== false;
} document.addEventListener('DOMContentLoaded', init);

el.coverInput.addEventListener('change', (e)=>{ const file = e.target.files?.[0]; if(!file) return; const reader = new FileReader(); reader.onload = () => { state.coverDataUrl = reader.result; el.coverImage.src = state.coverDataUrl; el.coverImage.style.display = 'block'; el.coverFallback.style.display = 'none'; el.coverInput.value = ''; }; reader.readAsDataURL(file); });
el.editBtn.addEventListener('click', ()=>{ renderEditGrid(); el.editDialog.showModal(); });
el.startBtn.addEventListener('click', ()=>{ state.title = el.titleInput.value.trim() || 'æŠ½æŠ½æ¨‚'; startGame(); });
el.importBtn.addEventListener('click', ()=>{ el.importText.value = ''; el.importDialog.showModal(); });
el.applyImportBtn?.addEventListener('click', (ev)=>{ if(ev.submitter?.value!=='apply') return; ev.preventDefault(); let text = el.importText.value.trim(); if(!text) return; const hash = text.includes('#')? text.split('#').pop() : text; const conf = decodeConfig(hash); if(!conf){ alert('è§£æžå¤±æ•—ï¼Œè«‹ç¢ºèªå…§å®¹æ˜¯å¦æ­£ç¢ºã€‚'); return; } Object.assign(state, conf); el.titleInput.value = state.title || ''; if(state.coverDataUrl){ el.coverImage.src = state.coverDataUrl; el.coverImage.style.display = 'block'; el.coverFallback.style.display='none'; } renderEditGrid(); el.allowRepeat.checked=!!state.allowRepeat; el.shuffleOnStart.checked=state.shuffleOnStart!==false; el.importDialog.close(); });

function renderEditGrid(){
  el.editGrid.innerHTML = '';
  state.prizes.forEach((p, i)=>{ const row = document.createElement('div'); row.className = 'edit-item'; row.innerHTML = `<input type="text" class="name" placeholder="çŽå“åç¨± #${i+1}" value="${p.name ?? ''}"/><input type="text" class="emoji" placeholder="Emoji" value="${p.emoji ?? ''}"/>`; el.editGrid.appendChild(row); });
}
el.savePrizesBtn.addEventListener('click', (ev)=>{ if(ev.submitter?.value!=='save') return; ev.preventDefault(); const rows = Array.from(el.editGrid.querySelectorAll('.edit-item')); const prizes = rows.map(r=>({name:r.querySelector('.name').value.trim()||'ç¥žç§˜çŽå“', emoji:r.querySelector('.emoji').value.trim()||'ðŸŽ'})); state.prizes = prizes.slice(0,9); state.allowRepeat = el.allowRepeat.checked; state.shuffleOnStart = el.shuffleOnStart.checked; el.editDialog.close(); });

function startGame(){
  state.opened = new Set(); el.openedCount.textContent = '0'; el.titleDisplay.textContent = state.title || 'æŠ½æŠ½æ¨‚';
  const idx = [...Array(9).keys()]; const order = state.shuffleOnStart ? shuffle(idx) : idx; el.grid.innerHTML = '';
  order.forEach((i, cellIdx)=>{ const prize = state.prizes[i]; const card = createCard(cellIdx, prize); el.grid.appendChild(card); });
  showScreen('game');
}
function shuffle(a){ const arr=a.slice(); for(let i=arr.length-1;i>0;i--){ const j=Math.floor(Math.random()*(i+1)); [arr[i],arr[j]]=[arr[j],arr[i]]; } return arr; }
function createCard(cellIndex, prize){ const card = document.createElement('div'); card.className='card'; card.dataset.index=String(cellIndex); card.innerHTML = `<div class="back"><div class="label">é»žæˆ‘æŠ½ï¼</div></div><div class="front" style="display:none;"><div class="prize"><div class="emoji">${escapeHtml(prize.emoji||'ðŸŽ')}</div><div class="name">${escapeHtml(prize.name||'ç¥žç§˜çŽå“')}</div></div></div><div class="shards"></div>`; prepareShards(card); card.addEventListener('click', ()=>{ if(card.classList.contains('opened')) return; shatter(card); reveal(card, prize); }); return card; }
function prepareShards(card){ const sds = card.querySelector('.shards'); sds.innerHTML=''; const pos = [[0,0],[1,0],[2,0],[0,1],[1,1],[2,1],[0,2],[1,2],[2,2]]; pos.forEach(([x,y])=>{ const s=document.createElement('div'); s.className='shard'; s.style.left=`${x*33.34}%`; s.style.top=`${y*33.34}%`; const tx=(Math.random()*160-80)+'px'; const ty=(Math.random()*-160-40)+'px'; const rot=(Math.random()*540-270)+'deg'; s.style.setProperty('--tx',tx); s.style.setProperty('--ty',ty); s.style.setProperty('--rot',rot); sds.appendChild(s); }); }
function shatter(card){ card.classList.add('break'); setTimeout(()=>{ card.querySelector('.shards').innerHTML=''; }, 950); }
function reveal(card, prize){ card.querySelector('.back').style.display='none'; card.querySelector('.front').style.display='grid'; card.classList.add('opened'); el.prizeEmoji.textContent = prize.emoji || 'ðŸŽ'; el.prizeName.textContent = prize.name || 'ç¥žç§˜çŽå“'; state.opened.add(card.dataset.index); el.openedCount.textContent = String(state.opened.size); el.prizeDialog.showModal(); }
el.closePrizeBtn.addEventListener('click', ()=> el.prizeDialog.close());
el.resetBtn.addEventListener('click', ()=>{ if(confirm('ç¢ºå®šè¦é‡ç½®ï¼Ÿæ‰€æœ‰å·²é–‹çš„çŽæœƒæ¸…ç©ºã€‚')) startGame(); });
el.backBtn.addEventListener('click', ()=> showScreen('cover'));
function showScreen(name){ el.cover.classList.toggle('visible', name==='cover'); el.game.classList.toggle('visible', name==='game'); }
el.shareBtn.addEventListener('click', async ()=>{ const conf = { title: state.title, prizes: state.prizes, allowRepeat: !!state.allowRepeat, shuffleOnStart: !!state.shuffleOnStart, coverDataUrl: state.coverDataUrl || null, }; const hash = encodeConfig(conf); const url = location.origin + location.pathname + '#' + hash; try{ if(navigator.share){ await navigator.share({title: state.title || 'æŠ½æŠ½æ¨‚', url}); } else { await navigator.clipboard.writeText(url); alert('å·²è¤‡è£½åˆ†äº«é€£çµåˆ°å‰ªè²¼ç°¿ï¼'); } }catch(e){ prompt('è¤‡è£½ä¸‹é¢çš„åˆ†äº«é€£çµï¼š', url); } });
function escapeHtml(s){ return String(s).replace(/[&<>"']/g, c => ({'&':'&amp;','<':'&lt;','>':'&gt;','"':'&quot;',"'":'&#39;'})[c]); }
